import React  from 'react';
import { View, Text, StyleSheet, TextInput, TouchableOpacity, Dimensions } from 'react-native';

const {width, height} = Dimensions.get('window');

const Post = ({ }) => {
    return(
        <View style={styles.container}>
         <View style={{ flexDirection:'row', justifyContent:'space-between'}}>
            <Text style={styles.posttxt}>Posts</Text>
            <Text style={styles.filtertxt}>Filters</Text>

         </View>
        </View>
    )
}

export default Post;


const styles = StyleSheet.create({
    container: {
        flex: 1, backgroundColor: '#2a322a', padding: 15
    },
    posttxt:{marginTop:10,marginBottom:0,fontSize:18,color:'#ffffff',fontWeight:'bold'
    },
    filtertxt:{marginTop:10,marginBottom:0,fontSize:18,color:"#0693E3",

    }
 })
